import React from "react";
import styled from "styled-components";
const WrapDiv = styled.div`
  width: 340px;
  height: 540px;
  padding: 10px;
  border-radius: 10px;
  background-color: #485461;
`;

const Wrap = ({ children }) => {
  return <WrapDiv>{children}</WrapDiv>;
};

export default Wrap;
